import json

from datetime import datetime

from flask import Flask, request, abort
from flask_sqlalchemy import SQLAlchemy
from sqlalchemy import and_

class Config:
    SQLALCHEMY_DATABASE_URI = 'postgresql://postgres:postgres@localhost/helpdb'
    AUTH_TOKEN = 'TEST1'

db = SQLAlchemy()

class Travelpayouts(db.Model):
    __tablename__ = 'travelpayouts'
    d_active_from = db.Column(db.DateTime)
    id_transfer =  db.Column(db.Numeric, primary_key=True)
    n_transfer = db.Column(db.Numeric)
    order_number = db.Column(db.Text)
    price = db.Column(db.Text)
    profit = db.Column(db.Text)
    currency = db.Column(db.Text)
    transfer_date_to = db.Column(db.Text)
    transfer_date_return = db.Column(db.Text)
    transfer_point_from = db.Column(db.Text)
    sub_id = db.Column(db.Text)
    status = db.Column(db.Text)
    updated_at = db.Column(db.Text)
    cpa_info = db.Column(db.Text)


config = Config()
app = Flask(__name__)
app.config.from_object(config)
db.init_app(app)

@app.route('/travelpayouts')
def travelpayouts():
    if request.headers.get('X-Access-Key') != config.AUTH_TOKEN:
        abort(401)
    DATE_PATTERN = '%Y-%m-%d'
    from_str, to_str = request.args.get("from"), request.args.get("to")
    from_date, to_date = None, None
    try:
        from_date, to_date = datetime.strptime(from_str, DATE_PATTERN), datetime.strptime(to_str, DATE_PATTERN)
    except TypeError:
        abort(500)
    except ValueError:
        abort(400)
    filtered, res = [], []
    query_result = Travelpayouts.query.all()
    for r in query_result:
        updated_at = datetime.strptime(r.updated_at, DATE_PATTERN)
        if from_date is not None and to_date is not None:
            if from_date <= updated_at <= to_date:
                filtered.append(r)
        elif from_date is None and to_date is not None:
            if updated_at <= to_date:
                filtered.append(r)
        elif from_date is not None and to_date is None:
            if from_date <= updated_at:
                filtered.append(r)
        elif from_date is not None and to_date is not None:
                filtered.append(r)
    for f in filtered:
        res.append({'order_number': f.order_number, 'price': f.price, 'profit': f.profit, 'currency': f.currency, 'description': {'transfer_date_to': f.transfer_date_to, 'transfer_date_return': f.transfer_date_return, 'transfer_point_from': f.transfer_point_from}, 'sub_id': f.sub_id, 'status': f.status, 'updated_at': f.updated_at})
    return json.dumps(res)
